                    <i class=\"fas fa-exclamation-triangle\"></i>
                    {{ message }}
                </div>
            {% endfor %}
            </div>
              <div class=\"row mt-5\">
                {% block body %}{% endblock %}        
              </div>
            </div>
          
        {% block javascripts %}
